def ok(n):
    s = bin(n)[2:]
    subs = (s[i:j] for i in range(len(s)) for j in range(i+1, len(s)+1) if s[i]!='0')
    return n and all(n%v == 0 for ss in subs if (v:=int(ss, 2)) > 0)
